import{_ as i,M as o,p as h,q as _,R as e,t as r,N as n,a1 as a}from"./framework-5866ffd3.js";const p={},s=a('<h2 id="必应今日图片-最近15天" tabindex="-1"><a class="header-anchor" href="#必应今日图片-最近15天" aria-hidden="true">#</a> 必应今日图片(最近15天)</h2><h3 id="_02月25日-冬天的布莱斯峡谷石林" tabindex="-1"><a class="header-anchor" href="#_02月25日-冬天的布莱斯峡谷石林" aria-hidden="true">#</a> 02月25日：冬天的布莱斯峡谷石林</h3><h4 id="布莱斯峡谷国家公园的石林-犹他州-美国-©-piriya-photography-getty-images" tabindex="-1"><a class="header-anchor" href="#布莱斯峡谷国家公园的石林-犹他州-美国-©-piriya-photography-getty-images" aria-hidden="true">#</a> 布莱斯峡谷国家公园的石林，犹他州，美国（© Piriya Photography/Getty Images）</h4><p><img src="https://cn.bing.com/th?id=OHR.BryceAnniv_ZH-CN5305245786_800x480.jpg&amp;rf=LaDigue_800x480.jpg" alt="冬天的布莱斯峡谷石林" title="冬天的布莱斯峡谷石林"></p><p>当太阳在布莱斯峡谷升起时，白雪皑皑的橙红色岩石闪闪发光。这些修长高耸的岩石被称为石林，而布莱斯峡谷国家公园正是因为拥有地球上密度最高的石林而闻名。这些石林的下层是松软的沉积岩，上面则覆盖着一层更为坚硬的石盖。犹他州冬天的冰霜会侵蚀石盖，最终暴露出底下更易被侵蚀的岩石。值得庆幸的是，这些石林现在还屹立不倒，让我们可以在公园成立100周年之时欣赏大自然的鬼斧神工。</p><p>布莱斯峡谷并非由流过的溪流侵蚀而成，因此严格来说它并不是一个峡谷。</p>',6),g={href:"https://cn.bing.com/search?q=%e5%b8%83%e8%8e%b1%e6%96%af%e5%b3%a1%e8%b0%b7%e5%9b%bd%e5%ae%b6%e5%85%ac%e5%9b%ad&form=hpcapt&filters=HpDate:%2220230224_1600%22",title:"必应今日图片 2023 2月 25",target:"_blank",rel:"noopener noreferrer"},c={href:"https://cn.bing.com/search?q=Bing+homepage+quiz&filters=WQOskey:%22HPQuiz_20230225_BryceAnniv%22&FORM=HPQUIZ",title:"必应主页测验 2023 2月 25",target:"_blank",rel:"noopener noreferrer"},l={href:"https://cn.bing.com/th?id=OHR.BryceAnniv_ZH-CN5305245786_800x480.jpg&rf=LaDigue_800x480.jpg",title:"布莱斯峡谷国家公园的石林，犹他州，美国",target:"_blank",rel:"noopener noreferrer"},d={href:"https://cn.bing.com/th?id=OHR.BryceAnniv_ZH-CN5305245786_1280x720.jpg&rf=LaDigue_1280x720.jpg",title:"布莱斯峡谷国家公园的石林，犹他州，美国",target:"_blank",rel:"noopener noreferrer"},b={href:"https://cn.bing.com/th?id=OHR.BryceAnniv_ZH-CN5305245786_1920x1080.jpg&rf=LaDigue_1920x1080.jpg",title:"布莱斯峡谷国家公园的石林，犹他州，美国",target:"_blank",rel:"noopener noreferrer"},f={href:"https://cn.bing.com/th?id=OHR.BryceAnniv_ZH-CN5305245786_UHD.jpg&rf=LaDigue_UHD.jpg",title:"布莱斯峡谷国家公园的石林，犹他州，美国",target:"_blank",rel:"noopener noreferrer"},H=a('<hr><h3 id="_02月24日-一只华丽招摇的鸳鸯" tabindex="-1"><a class="header-anchor" href="#_02月24日-一只华丽招摇的鸳鸯" aria-hidden="true">#</a> 02月24日：一只华丽招摇的鸳鸯</h3><h4 id="里士满公园的鸳鸯-伦敦-英国-©-oscar-dewhurst-minden-pictures" tabindex="-1"><a class="header-anchor" href="#里士满公园的鸳鸯-伦敦-英国-©-oscar-dewhurst-minden-pictures" aria-hidden="true">#</a> 里士满公园的鸳鸯，伦敦，英国（© Oscar Dewhurst/Minden Pictures）</h4><p><img src="https://cn.bing.com/th?id=OHR.RichmondParkDuck_ZH-CN4956127005_800x480.jpg&amp;rf=LaDigue_800x480.jpg" alt="一只华丽招摇的鸳鸯" title="一只华丽招摇的鸳鸯"></p><p>今天照片里的是一只鸳鸯，它正在寒冷沉闷的冬日里展示自己漂亮鲜艳的羽毛。到了换羽季节，雄性鸳鸯会脱去色彩斑斓的羽毛，使得它们的外貌更接近色彩暗淡的雌性鸳鸯，不过它们的喙仍然会是明亮的橙黄色或红色。</p><p>里士满公园修建于17世纪，原本是查理一世的鹿园，现在已成为国家级的自然保护区。</p>',6),m={href:"https://cn.bing.com/search?q=%e9%b8%b3%e9%b8%af&form=hpcapt&filters=HpDate:%2220230223_1600%22",title:"必应今日图片 2023 2月 24",target:"_blank",rel:"noopener noreferrer"},u={href:"https://cn.bing.com/search?q=Bing+homepage+quiz&filters=WQOskey:%22HPQuiz_20230224_RichmondParkDuck%22&FORM=HPQUIZ",title:"必应主页测验 2023 2月 24",target:"_blank",rel:"noopener noreferrer"},D={href:"https://cn.bing.com/th?id=OHR.RichmondParkDuck_ZH-CN4956127005_800x480.jpg&rf=LaDigue_800x480.jpg",title:"里士满公园的鸳鸯，伦敦，英国",target:"_blank",rel:"noopener noreferrer"},k={href:"https://cn.bing.com/th?id=OHR.RichmondParkDuck_ZH-CN4956127005_1280x720.jpg&rf=LaDigue_1280x720.jpg",title:"里士满公园的鸳鸯，伦敦，英国",target:"_blank",rel:"noopener noreferrer"},x={href:"https://cn.bing.com/th?id=OHR.RichmondParkDuck_ZH-CN4956127005_1920x1080.jpg&rf=LaDigue_1920x1080.jpg",title:"里士满公园的鸳鸯，伦敦，英国",target:"_blank",rel:"noopener noreferrer"},j={href:"https://cn.bing.com/th?id=OHR.RichmondParkDuck_ZH-CN4956127005_UHD.jpg&rf=LaDigue_UHD.jpg",title:"里士满公园的鸳鸯，伦敦，英国",target:"_blank",rel:"noopener noreferrer"},O=a('<hr><h3 id="_02月23日-宁静的山谷" tabindex="-1"><a class="header-anchor" href="#_02月23日-宁静的山谷" aria-hidden="true">#</a> 02月23日：宁静的山谷</h3><h4 id="克罗索尔山谷-斯诺多尼亚国家公园-英国威尔士-©-matthew-williams-ellis-plainpicture" tabindex="-1"><a class="header-anchor" href="#克罗索尔山谷-斯诺多尼亚国家公园-英国威尔士-©-matthew-williams-ellis-plainpicture" aria-hidden="true">#</a> 克罗索尔山谷，斯诺多尼亚国家公园，英国威尔士（© Matthew Williams Ellis/Plainpicture）</h4><p><img src="https://cn.bing.com/th?id=OHR.BabblingBrook_ZH-CN9371346787_800x480.jpg&amp;rf=LaDigue_800x480.jpg" alt="宁静的山谷" title="宁静的山谷"></p><p>今天照片中展示的宁静山谷坐落在北威尔士格的斯诺登尼亚国家公园。克罗伊索（Croesor）峡谷曾经是热闹非凡的采石场，专门生产用于建造屋顶及地板的石板。如今这里没有了采石的喧嚣，只有长满苔藓的石墙、潺潺的溪流、羊群啃过的田野和台阶，还有穿过这里前往莫尔温尼恩（Moelwynion）山脉的徒步者。</p><p>威尔士被誉为神话传说之地。传说两条古龙曾在威尔士的迪纳斯埃姆里斯山展开一场大战。</p>',6),R={href:"https://cn.bing.com/search?q=%e6%96%af%e8%af%ba%e7%99%bb%e5%b0%bc%e4%ba%9a%e5%9b%bd%e5%ae%b6%e5%85%ac%e5%9b%ad&form=hpcapt&filters=HpDate:%2220230222_1600%22",title:"必应今日图片 2023 2月 23",target:"_blank",rel:"noopener noreferrer"},Z={href:"https://cn.bing.com/search?q=Bing+homepage+quiz&filters=WQOskey:%22HPQuiz_20230223_BabblingBrook%22&FORM=HPQUIZ",title:"必应主页测验 2023 2月 23",target:"_blank",rel:"noopener noreferrer"},y={href:"https://cn.bing.com/th?id=OHR.BabblingBrook_ZH-CN9371346787_800x480.jpg&rf=LaDigue_800x480.jpg",title:"克罗索尔山谷，斯诺多尼亚国家公园，英国威尔士",target:"_blank",rel:"noopener noreferrer"},C={href:"https://cn.bing.com/th?id=OHR.BabblingBrook_ZH-CN9371346787_1280x720.jpg&rf=LaDigue_1280x720.jpg",title:"克罗索尔山谷，斯诺多尼亚国家公园，英国威尔士",target:"_blank",rel:"noopener noreferrer"},N={href:"https://cn.bing.com/th?id=OHR.BabblingBrook_ZH-CN9371346787_1920x1080.jpg&rf=LaDigue_1920x1080.jpg",title:"克罗索尔山谷，斯诺多尼亚国家公园，英国威尔士",target:"_blank",rel:"noopener noreferrer"},L={href:"https://cn.bing.com/th?id=OHR.BabblingBrook_ZH-CN9371346787_UHD.jpg&rf=LaDigue_UHD.jpg",title:"克罗索尔山谷，斯诺多尼亚国家公园，英国威尔士",target:"_blank",rel:"noopener noreferrer"},B=a('<hr><h3 id="_02月22日-和平之钟" tabindex="-1"><a class="header-anchor" href="#_02月22日-和平之钟" aria-hidden="true">#</a> 02月22日：和平之钟</h3><h4 id="菲希特尔山脉上的和平钟-萨克森州-德国-©-jan-drahokoupil-getty-images" tabindex="-1"><a class="header-anchor" href="#菲希特尔山脉上的和平钟-萨克森州-德国-©-jan-drahokoupil-getty-images" aria-hidden="true">#</a> 菲希特尔山脉上的和平钟，萨克森州，德国（© Jan Drahokoupil/Getty Images）</h4><p><img src="https://cn.bing.com/th?id=OHR.FriedensglockeFichtelberg_ZH-CN5510489151_800x480.jpg&amp;rf=LaDigue_800x480.jpg" alt="和平之钟" title="和平之钟"></p><p>菲希特尔山位于厄尔士山脉的上维森塔尔镇附近。这座山高1214米，是东德最高的山峰，也是冬季运动爱好者的圣地。这里有各种冬季运动，双板滑雪、单板滑雪、越野滑雪、雪橇雪橇和马拉雪橇等等。如果你更喜欢夏天，也可以在这里来场夏日旅行，体验这里的自然风景。在菲希特尔山顶有一座和平钟，在这里欣赏到周围群山的壮丽景色。</p><p>菲希特尔山的南麓坐落着德国海拔最高的城镇——上维森塔尔，这是一个位于波尔巴赫山谷的度假小镇。</p>',6),U={href:"https://cn.bing.com/search?q=%e8%8f%b2%e5%b8%8c%e7%89%b9%e5%b0%94%e5%b1%b1&form=hpcapt&filters=HpDate:%2220230221_1600%22",title:"必应今日图片 2023 2月 22",target:"_blank",rel:"noopener noreferrer"},I={href:"https://cn.bing.com/search?q=Bing+homepage+quiz&filters=WQOskey:%22HPQuiz_20230222_FriedensglockeFichtelberg%22&FORM=HPQUIZ",title:"必应主页测验 2023 2月 22",target:"_blank",rel:"noopener noreferrer"},q={href:"https://cn.bing.com/th?id=OHR.FriedensglockeFichtelberg_ZH-CN5510489151_800x480.jpg&rf=LaDigue_800x480.jpg",title:"菲希特尔山脉上的和平钟，萨克森州，德国",target:"_blank",rel:"noopener noreferrer"},P={href:"https://cn.bing.com/th?id=OHR.FriedensglockeFichtelberg_ZH-CN5510489151_1280x720.jpg&rf=LaDigue_1280x720.jpg",title:"菲希特尔山脉上的和平钟，萨克森州，德国",target:"_blank",rel:"noopener noreferrer"},z={href:"https://cn.bing.com/th?id=OHR.FriedensglockeFichtelberg_ZH-CN5510489151_1920x1080.jpg&rf=LaDigue_1920x1080.jpg",title:"菲希特尔山脉上的和平钟，萨克森州，德国",target:"_blank",rel:"noopener noreferrer"},Q={href:"https://cn.bing.com/th?id=OHR.FriedensglockeFichtelberg_ZH-CN5510489151_UHD.jpg&rf=LaDigue_UHD.jpg",title:"菲希特尔山脉上的和平钟，萨克森州，德国",target:"_blank",rel:"noopener noreferrer"},M=a('<hr><h3 id="_02月21日-带上国王饼" tabindex="-1"><a class="header-anchor" href="#_02月21日-带上国王饼" aria-hidden="true">#</a> 02月21日：带上国王饼</h3><h4 id="新奥尔良法语区-路易斯安那州-©-f11photo-getty-images" tabindex="-1"><a class="header-anchor" href="#新奥尔良法语区-路易斯安那州-©-f11photo-getty-images" aria-hidden="true">#</a> 新奥尔良法语区，路易斯安那州（© f11photo/Getty Images）</h4><p><img src="https://cn.bing.com/th?id=OHR.MardiGrasNOLA_ZH-CN9628788934_800x480.jpg&amp;rf=LaDigue_800x480.jpg" alt="带上国王饼" title="带上国王饼"></p><p>新奥尔良（New Orleans），是美国路易斯安那州南部的一座海港城市，同时也是该州最大的城市，行政上与奥尔良县重合。新奥尔良最有特色的建筑大多聚集在法语区老城。在西班牙统治新奥尔良的40年间法语区的两场大火把法国老式建筑烧了个精光，尤以1788年那场最为惨重。如今法国区的街道非常狭窄，各家各户紧密相连，斑驳的老墙之上，二楼的雕花栏杆小阳台们常常被绿色的垂吊花草布满，一年四季都绚烂艳丽。</p><p>法语区里那些浮华精致的雕花生铁阑干阳台都是西班牙建筑的风格，只有位于杜梅街上的“约翰夫人家”还可隐隐窥见法国乡间木屋的风貌。</p>',6),F={href:"https://cn.bing.com/search?q=%e6%96%b0%e5%a5%a5%e5%b0%94%e8%89%af%e6%b3%95%e8%af%ad%e5%8c%ba&form=hpcapt&filters=HpDate:%2220230220_1600%22",title:"必应今日图片 2023 2月 21",target:"_blank",rel:"noopener noreferrer"},w={href:"https://cn.bing.com/search?q=Bing+homepage+quiz&filters=WQOskey:%22HPQuiz_20230221_MardiGrasNOLA%22&FORM=HPQUIZ",title:"必应主页测验 2023 2月 21",target:"_blank",rel:"noopener noreferrer"},W={href:"https://cn.bing.com/th?id=OHR.MardiGrasNOLA_ZH-CN9628788934_800x480.jpg&rf=LaDigue_800x480.jpg",title:"新奥尔良法语区，路易斯安那州",target:"_blank",rel:"noopener noreferrer"},A={href:"https://cn.bing.com/th?id=OHR.MardiGrasNOLA_ZH-CN9628788934_1280x720.jpg&rf=LaDigue_1280x720.jpg",title:"新奥尔良法语区，路易斯安那州",target:"_blank",rel:"noopener noreferrer"},V={href:"https://cn.bing.com/th?id=OHR.MardiGrasNOLA_ZH-CN9628788934_1920x1080.jpg&rf=LaDigue_1920x1080.jpg",title:"新奥尔良法语区，路易斯安那州",target:"_blank",rel:"noopener noreferrer"},v={href:"https://cn.bing.com/th?id=OHR.MardiGrasNOLA_ZH-CN9628788934_UHD.jpg&rf=LaDigue_UHD.jpg",title:"新奥尔良法语区，路易斯安那州",target:"_blank",rel:"noopener noreferrer"},G=a('<hr><h3 id="_02月20日-在大自然中漫步" tabindex="-1"><a class="header-anchor" href="#_02月20日-在大自然中漫步" aria-hidden="true">#</a> 02月20日：在大自然中漫步</h3><h4 id="itaimbezinho峡谷-巴西-©-nidohuebl-getty-images" tabindex="-1"><a class="header-anchor" href="#itaimbezinho峡谷-巴西-©-nidohuebl-getty-images" aria-hidden="true">#</a> Itaimbezinho峡谷，巴西（© NidoHuebl/Getty Images）</h4><p><img src="https://cn.bing.com/th?id=OHR.Itaimbezinho_ZH-CN5641449623_800x480.jpg&amp;rf=LaDigue_800x480.jpg" alt="在大自然中漫步" title="在大自然中漫步"></p><p>Itaimbezinho 峡谷是南里奥格兰德州最著名的峡谷。它是巴西自然奇观之一，位于南坎巴拉市，它是巴西南坎巴拉市的自然奇观之一，位于阿帕拉多斯达塞拉国家公园内。Itaimbezinho峡谷两侧的峭壁非常直，如刀切一般。Itaimbezinho峡谷名字便得名于峭壁的特征，在图皮瓜拉尼语中：&quot;ita&quot;的意思是石头，&quot;aimbé&quot;的意思是切割和锋利。</p><p>峡谷地区也是印第安人的栖息地，也是多部肥皂剧和迷你剧的取景地。</p>',6),S={href:"https://cn.bing.com/search?q=%e5%b7%b4%e8%a5%bf%e5%a5%a5%e6%a0%bc%e5%85%b0%e5%be%b7%e5%b7%9e&form=hpcapt&filters=HpDate:%2220230219_1600%22",title:"必应今日图片 2023 2月 20",target:"_blank",rel:"noopener noreferrer"},E={href:"https://cn.bing.com/search?q=Bing+homepage+quiz&filters=WQOskey:%22HPQuiz_20230220_Itaimbezinho%22&FORM=HPQUIZ",title:"必应主页测验 2023 2月 20",target:"_blank",rel:"noopener noreferrer"},Y={href:"https://cn.bing.com/th?id=OHR.Itaimbezinho_ZH-CN5641449623_800x480.jpg&rf=LaDigue_800x480.jpg",title:"Itaimbezinho峡谷，巴西",target:"_blank",rel:"noopener noreferrer"},T={href:"https://cn.bing.com/th?id=OHR.Itaimbezinho_ZH-CN5641449623_1280x720.jpg&rf=LaDigue_1280x720.jpg",title:"Itaimbezinho峡谷，巴西",target:"_blank",rel:"noopener noreferrer"},J={href:"https://cn.bing.com/th?id=OHR.Itaimbezinho_ZH-CN5641449623_1920x1080.jpg&rf=LaDigue_1920x1080.jpg",title:"Itaimbezinho峡谷，巴西",target:"_blank",rel:"noopener noreferrer"},K={href:"https://cn.bing.com/th?id=OHR.Itaimbezinho_ZH-CN5641449623_UHD.jpg&rf=LaDigue_UHD.jpg",title:"Itaimbezinho峡谷，巴西",target:"_blank",rel:"noopener noreferrer"},X=a('<hr><h3 id="_02月19日-海洋之王" tabindex="-1"><a class="header-anchor" href="#_02月19日-海洋之王" aria-hidden="true">#</a> 02月19日：海洋之王</h3><h4 id="毛伊岛附近的座头鲸-美国夏威夷-©-flip-nicklin-minden-pictures" tabindex="-1"><a class="header-anchor" href="#毛伊岛附近的座头鲸-美国夏威夷-©-flip-nicklin-minden-pictures" aria-hidden="true">#</a> 毛伊岛附近的座头鲸，美国夏威夷（© Flip Nicklin/Minden Pictures）</h4><p><img src="https://cn.bing.com/th?id=OHR.MauiWhale_ZH-CN6664793962_800x480.jpg&amp;rf=LaDigue_800x480.jpg" alt="海洋之王" title="海洋之王"></p><p>在座头鲸巨大体型的衬托之下，你会觉得自己是如此的渺小。成年座头鲸体长达46-56英尺以上，是地球上最大的哺乳动物之一。夏威夷毛伊岛每年都会举办鲸鱼节，游客们可以参加观鲸活动，近距离接触这些美丽的庞然大物。座头鲸是须鲸的一种，以擅长唱歌而闻名，它们嘹亮优美的歌声甚至可以在水中传到“千里之外”。有趣的是，每个鲸鱼群都有自己的鲸歌，并且只有雄性鲸鱼才唱歌。此外，鲸鱼还是河马的远亲，它们是从同一个祖先进化而来。</p><p>座头鲸和其他鲸鱼一样，会突然破水而出，落水时溅起巨大的水花。科学家们也不确定这种行为是否有特殊的目的。</p>',6),$={href:"https://cn.bing.com/search?q=%e5%ba%a7%e5%a4%b4%e9%b2%b8&form=hpcapt&filters=HpDate:%2220230218_1600%22",title:"必应今日图片 2023 2月 19",target:"_blank",rel:"noopener noreferrer"},ee={href:"https://cn.bing.com/search?q=Bing+homepage+quiz&filters=WQOskey:%22HPQuiz_20230219_MauiWhale%22&FORM=HPQUIZ",title:"必应主页测验 2023 2月 19",target:"_blank",rel:"noopener noreferrer"},te={href:"https://cn.bing.com/th?id=OHR.MauiWhale_ZH-CN6664793962_800x480.jpg&rf=LaDigue_800x480.jpg",title:"毛伊岛附近的座头鲸，美国夏威夷",target:"_blank",rel:"noopener noreferrer"},re={href:"https://cn.bing.com/th?id=OHR.MauiWhale_ZH-CN6664793962_1280x720.jpg&rf=LaDigue_1280x720.jpg",title:"毛伊岛附近的座头鲸，美国夏威夷",target:"_blank",rel:"noopener noreferrer"},ne={href:"https://cn.bing.com/th?id=OHR.MauiWhale_ZH-CN6664793962_1920x1080.jpg&rf=LaDigue_1920x1080.jpg",title:"毛伊岛附近的座头鲸，美国夏威夷",target:"_blank",rel:"noopener noreferrer"},ae={href:"https://cn.bing.com/th?id=OHR.MauiWhale_ZH-CN6664793962_UHD.jpg&rf=LaDigue_UHD.jpg",title:"毛伊岛附近的座头鲸，美国夏威夷",target:"_blank",rel:"noopener noreferrer"},ie=a('<hr><h3 id="_02月18日-令人叹为观止的冰洞" tabindex="-1"><a class="header-anchor" href="#_02月18日-令人叹为观止的冰洞" aria-hidden="true">#</a> 02月18日：令人叹为观止的冰洞</h3><h4 id="埃本冰洞-密歇根上半岛-美国-©-dean-pennala-shutterstock" tabindex="-1"><a class="header-anchor" href="#埃本冰洞-密歇根上半岛-美国-©-dean-pennala-shutterstock" aria-hidden="true">#</a> 埃本冰洞，密歇根上半岛，美国（© Dean Pennala/Shutterstock）</h4><p><img src="https://cn.bing.com/th?id=OHR.EbenIceCave_ZH-CN6035107581_800x480.jpg&amp;rf=LaDigue_800x480.jpg" alt="令人叹为观止的冰洞" title="令人叹为观止的冰洞"></p><p>只有在密歇根上半岛寒冷的冬季，埃本冰洞才会形成。在其余时间里，游客们只能看到砂岩绝壁和雪松树。当气温下降时，水流过峡谷绝壁，凝结成美丽的黄色冰柱和冰壁，游客可以在空隙之间穿行。注意：带上冰爪或登山靴，当心野生动物！尽管密歇根州只有3%的人口住在上半岛，但这里野生动物的数量却不少，包括熊、驼鹿和狼。</p><p>埃本冰洞的冰墙可高达50英尺，周围的砂岩和雪松使冰的色调呈黄色。</p>',6),oe={href:"https://cn.bing.com/search?q=%e5%86%b0%e6%b4%9e&form=hpcapt&filters=HpDate:%2220230217_1600%22",title:"必应今日图片 2023 2月 18",target:"_blank",rel:"noopener noreferrer"},he={href:"https://cn.bing.com/search?q=Bing+homepage+quiz&filters=WQOskey:%22HPQuiz_20230218_EbenIceCave%22&FORM=HPQUIZ",title:"必应主页测验 2023 2月 18",target:"_blank",rel:"noopener noreferrer"},_e={href:"https://cn.bing.com/th?id=OHR.EbenIceCave_ZH-CN6035107581_800x480.jpg&rf=LaDigue_800x480.jpg",title:"埃本冰洞，密歇根上半岛，美国",target:"_blank",rel:"noopener noreferrer"},pe={href:"https://cn.bing.com/th?id=OHR.EbenIceCave_ZH-CN6035107581_1280x720.jpg&rf=LaDigue_1280x720.jpg",title:"埃本冰洞，密歇根上半岛，美国",target:"_blank",rel:"noopener noreferrer"},se={href:"https://cn.bing.com/th?id=OHR.EbenIceCave_ZH-CN6035107581_1920x1080.jpg&rf=LaDigue_1920x1080.jpg",title:"埃本冰洞，密歇根上半岛，美国",target:"_blank",rel:"noopener noreferrer"},ge={href:"https://cn.bing.com/th?id=OHR.EbenIceCave_ZH-CN6035107581_UHD.jpg&rf=LaDigue_UHD.jpg",title:"埃本冰洞，密歇根上半岛，美国",target:"_blank",rel:"noopener noreferrer"},ce=a('<hr><h3 id="_02月17日-后院鸟类统计-活动开始了" tabindex="-1"><a class="header-anchor" href="#_02月17日-后院鸟类统计-活动开始了" aria-hidden="true">#</a> 02月17日：“后院鸟类统计”活动开始了！</h3><h4 id="栖息在红袋鼠爪枝干上的艾氏煌蜂鸟-©-gypsypictureshow-shutterstock" tabindex="-1"><a class="header-anchor" href="#栖息在红袋鼠爪枝干上的艾氏煌蜂鸟-©-gypsypictureshow-shutterstock" aria-hidden="true">#</a> 栖息在红袋鼠爪枝干上的艾氏煌蜂鸟（© GypsyPictureShow/Shutterstock）</h4><p><img src="https://cn.bing.com/th?id=OHR.BirdcountAllen_ZH-CN4029022734_800x480.jpg&amp;rf=LaDigue_800x480.jpg" alt="“后院鸟类统计”活动开始了！" title="“后院鸟类统计”活动开始了！"></p><p>让我们尽点绵薄之力，帮助科学家更多地了解全球鸟类数量吧。“后院鸟类统计”是一项为期四天的年度活动，起源于美国，目前已推广至全世界。该活动鼓励观鸟者留意当地的鸟类，并通过eBird平台上传报告。例如，如果你在墨西哥中南部，你可能会看到一只在这里过冬的艾氏煌蜂鸟。活动的统计结果将被汇总并公布在网上，供科学家和有兴趣的网友查阅。据估计，全球有10000种鸟类。在这个激动人心的周末，带上你的设备，出门观鸟吧！</p><p>科学家估计全球约有10000种鸟类。</p>',6),le={href:"https://cn.bing.com/search?q=%e8%89%be%e6%b0%8f%e7%85%8c%e8%9c%82%e9%b8%9f&form=hpcapt&filters=HpDate:%2220230216_1600%22",title:"必应今日图片 2023 2月 17",target:"_blank",rel:"noopener noreferrer"},de={href:"https://cn.bing.com/search?q=Bing+homepage+quiz&filters=WQOskey:%22HPQuiz_20230217_BirdcountAllen%22&FORM=HPQUIZ",title:"必应主页测验 2023 2月 17",target:"_blank",rel:"noopener noreferrer"},be={href:"https://cn.bing.com/th?id=OHR.BirdcountAllen_ZH-CN4029022734_800x480.jpg&rf=LaDigue_800x480.jpg",title:"栖息在红袋鼠爪枝干上的艾氏煌蜂鸟",target:"_blank",rel:"noopener noreferrer"},fe={href:"https://cn.bing.com/th?id=OHR.BirdcountAllen_ZH-CN4029022734_1280x720.jpg&rf=LaDigue_1280x720.jpg",title:"栖息在红袋鼠爪枝干上的艾氏煌蜂鸟",target:"_blank",rel:"noopener noreferrer"},He={href:"https://cn.bing.com/th?id=OHR.BirdcountAllen_ZH-CN4029022734_1920x1080.jpg&rf=LaDigue_1920x1080.jpg",title:"栖息在红袋鼠爪枝干上的艾氏煌蜂鸟",target:"_blank",rel:"noopener noreferrer"},me={href:"https://cn.bing.com/th?id=OHR.BirdcountAllen_ZH-CN4029022734_UHD.jpg&rf=LaDigue_UHD.jpg",title:"栖息在红袋鼠爪枝干上的艾氏煌蜂鸟",target:"_blank",rel:"noopener noreferrer"},ue=a('<hr><h3 id="_02月16日-这个悬崖怎么着火了" tabindex="-1"><a class="header-anchor" href="#_02月16日-这个悬崖怎么着火了" aria-hidden="true">#</a> 02月16日：这个悬崖怎么着火了？</h3><h4 id="火流-马尾瀑布-约塞米蒂国家公园-美国加利福尼亚州-©-jeff-lewis-tandem-stills-motion" tabindex="-1"><a class="header-anchor" href="#火流-马尾瀑布-约塞米蒂国家公园-美国加利福尼亚州-©-jeff-lewis-tandem-stills-motion" aria-hidden="true">#</a> “火流”马尾瀑布，约塞米蒂国家公园，美国加利福尼亚州（© Jeff Lewis/Tandem Stills + Motion）</h4><p><img src="https://cn.bing.com/th?id=OHR.FireFallYosemite_ZH-CN3351604820_800x480.jpg&amp;rf=LaDigue_800x480.jpg" alt="这个悬崖怎么着火了？" title="这个悬崖怎么着火了？"></p><p>在约塞米蒂国家公园的埃尔卡皮坦山东侧，当所有自然条件齐备，马尾瀑布就像火一样“燃烧”起来。这种现象只有在2月的几周时间里可以看到，前提是天气晴朗，雪水或雨水形成瀑布，并且光照条件恰到好处。“火瀑布”只会持续大约10分钟，届时，观景区会人潮涌动。希望今年的游客能有幸看到这一神奇的自然景观。</p><p>火瀑布的形成需要几个要素：下了足量的雪，天气够暖和，雪融化后形成瀑布，天空晴朗无云，阳光照耀的角度正合适，然后瀑布才会“燃烧”。</p>',6),De={href:"https://cn.bing.com/search?q=%e7%ba%a6%e5%a1%9e%e7%b1%b3%e8%92%82%e7%81%ab%e7%80%91%e5%b8%83&form=hpcapt&filters=HpDate:%2220230215_1600%22",title:"必应今日图片 2023 2月 16",target:"_blank",rel:"noopener noreferrer"},ke={href:"https://cn.bing.com/search?q=Bing+homepage+quiz&filters=WQOskey:%22HPQuiz_20230216_FireFallYosemite%22&FORM=HPQUIZ",title:"必应主页测验 2023 2月 16",target:"_blank",rel:"noopener noreferrer"},xe={href:"https://cn.bing.com/th?id=OHR.FireFallYosemite_ZH-CN3351604820_800x480.jpg&rf=LaDigue_800x480.jpg",title:"“火流”马尾瀑布，约塞米蒂国家公园，美国加利福尼亚州",target:"_blank",rel:"noopener noreferrer"},je={href:"https://cn.bing.com/th?id=OHR.FireFallYosemite_ZH-CN3351604820_1280x720.jpg&rf=LaDigue_1280x720.jpg",title:"“火流”马尾瀑布，约塞米蒂国家公园，美国加利福尼亚州",target:"_blank",rel:"noopener noreferrer"},Oe={href:"https://cn.bing.com/th?id=OHR.FireFallYosemite_ZH-CN3351604820_1920x1080.jpg&rf=LaDigue_1920x1080.jpg",title:"“火流”马尾瀑布，约塞米蒂国家公园，美国加利福尼亚州",target:"_blank",rel:"noopener noreferrer"},Re={href:"https://cn.bing.com/th?id=OHR.FireFallYosemite_ZH-CN3351604820_UHD.jpg&rf=LaDigue_UHD.jpg",title:"“火流”马尾瀑布，约塞米蒂国家公园，美国加利福尼亚州",target:"_blank",rel:"noopener noreferrer"},Ze=a('<hr><h3 id="_02月15日-世界河马日-隆重的庆典" tabindex="-1"><a class="header-anchor" href="#_02月15日-世界河马日-隆重的庆典" aria-hidden="true">#</a> 02月15日：世界河马日，隆重的庆典</h3><h4 id="河马妈妈和宝宝-乔贝国家公园-博茨瓦纳-©-jacobeukman-getty-images" tabindex="-1"><a class="header-anchor" href="#河马妈妈和宝宝-乔贝国家公园-博茨瓦纳-©-jacobeukman-getty-images" aria-hidden="true">#</a> 河马妈妈和宝宝，乔贝国家公园，博茨瓦纳（© jacobeukman/Getty Images）</h4><p><img src="https://cn.bing.com/th?id=OHR.HippoDayChobe_ZH-CN2883647954_800x480.jpg&amp;rf=LaDigue_800x480.jpg" alt="世界河马日，隆重的庆典" title="世界河马日，隆重的庆典"></p><p>今天是世界河马日，河马是地球上最重的陆地动物之一。这些非洲食草动物生活在撒哈拉沙漠以南的非洲大陆。尽管河马分布广泛，但由于栖息地的不断减少，它们已被列为易危物种。虽然河马一生都生活在水里或水域附近，但它们不会游泳，而是通过跳跃在水里移动。河马在野外可以活到40岁，它们的嘴巴是陆地动物中最大的，所以在面对镜头时，它们的微笑也很自然。</p><p>虽然河马的名字来自希腊语，意思是“河里的马”——因为它们大部分时间在河里度过，但河马的近亲其实是鲸鱼、海豚和猪。</p>',6),ye={href:"https://cn.bing.com/search?q=%e6%b2%b3%e9%a9%ac&form=hpcapt&filters=HpDate:%2220230214_1600%22",title:"必应今日图片 2023 2月 15",target:"_blank",rel:"noopener noreferrer"},Ce={href:"https://cn.bing.com/search?q=Bing+homepage+quiz&filters=WQOskey:%22HPQuiz_20230215_HippoDayChobe%22&FORM=HPQUIZ",title:"必应主页测验 2023 2月 15",target:"_blank",rel:"noopener noreferrer"},Ne={href:"https://cn.bing.com/th?id=OHR.HippoDayChobe_ZH-CN2883647954_800x480.jpg&rf=LaDigue_800x480.jpg",title:"河马妈妈和宝宝，乔贝国家公园，博茨瓦纳",target:"_blank",rel:"noopener noreferrer"},Le={href:"https://cn.bing.com/th?id=OHR.HippoDayChobe_ZH-CN2883647954_1280x720.jpg&rf=LaDigue_1280x720.jpg",title:"河马妈妈和宝宝，乔贝国家公园，博茨瓦纳",target:"_blank",rel:"noopener noreferrer"},Be={href:"https://cn.bing.com/th?id=OHR.HippoDayChobe_ZH-CN2883647954_1920x1080.jpg&rf=LaDigue_1920x1080.jpg",title:"河马妈妈和宝宝，乔贝国家公园，博茨瓦纳",target:"_blank",rel:"noopener noreferrer"},Ue={href:"https://cn.bing.com/th?id=OHR.HippoDayChobe_ZH-CN2883647954_UHD.jpg&rf=LaDigue_UHD.jpg",title:"河马妈妈和宝宝，乔贝国家公园，博茨瓦纳",target:"_blank",rel:"noopener noreferrer"},Ie=a('<hr><h3 id="_02月14日-雪中之恋" tabindex="-1"><a class="header-anchor" href="#_02月14日-雪中之恋" aria-hidden="true">#</a> 02月14日：雪中之恋</h3><h4 id="日本北海道小樽雪灯之路的冰屋-©-t-photography-shutterstock" tabindex="-1"><a class="header-anchor" href="#日本北海道小樽雪灯之路的冰屋-©-t-photography-shutterstock" aria-hidden="true">#</a> 日本北海道小樽雪灯之路的冰屋（© T Photography/Shutterstock）</h4><p><img src="https://cn.bing.com/th?id=OHR.OtaruIgloo_ZH-CN2078929256_800x480.jpg&amp;rf=LaDigue_800x480.jpg" alt="雪中之恋" title="雪中之恋"></p><p>情人节到了！情人节也许是世界上最受欢迎的节日之一了。这是一个庆祝爱情、表达爱意的日子。虽然情人节的起源尚不清楚，但它经常与各种古老的节日联系在一起，比如牧神节和圣瓦伦丁节。今天，情人节已经演变成一个庆祝爱情的大型文化和商业活动。如果你想让这一天更有意义，你可以做很多事情。你可以在最喜欢的餐厅来一场约会，也可以策划一些活动，比如两人来一场日本之旅，体验小樽雪灯之路的冬季仙境。</p><p>情人节送糖果的传统始于19世纪，由英国巧克力制造家族的理查德·吉百利开创。</p>',6),qe={href:"https://cn.bing.com/search?q=%e5%b0%8f%e6%a8%bd%e9%9b%aa%e7%81%af%e4%b9%8b%e8%b7%af&form=hpcapt&filters=HpDate:%2220230213_1600%22",title:"必应今日图片 2023 2月 14",target:"_blank",rel:"noopener noreferrer"},Pe={href:"https://cn.bing.com/search?q=Bing+homepage+quiz&filters=WQOskey:%22HPQuiz_20230214_OtaruIgloo%22&FORM=HPQUIZ",title:"必应主页测验 2023 2月 14",target:"_blank",rel:"noopener noreferrer"},ze={href:"https://cn.bing.com/th?id=OHR.OtaruIgloo_ZH-CN2078929256_800x480.jpg&rf=LaDigue_800x480.jpg",title:"日本北海道小樽雪灯之路的冰屋",target:"_blank",rel:"noopener noreferrer"},Qe={href:"https://cn.bing.com/th?id=OHR.OtaruIgloo_ZH-CN2078929256_1280x720.jpg&rf=LaDigue_1280x720.jpg",title:"日本北海道小樽雪灯之路的冰屋",target:"_blank",rel:"noopener noreferrer"},Me={href:"https://cn.bing.com/th?id=OHR.OtaruIgloo_ZH-CN2078929256_1920x1080.jpg&rf=LaDigue_1920x1080.jpg",title:"日本北海道小樽雪灯之路的冰屋",target:"_blank",rel:"noopener noreferrer"},Fe={href:"https://cn.bing.com/th?id=OHR.OtaruIgloo_ZH-CN2078929256_UHD.jpg&rf=LaDigue_UHD.jpg",title:"日本北海道小樽雪灯之路的冰屋",target:"_blank",rel:"noopener noreferrer"},we=a('<hr><h3 id="_02月13日-带我飞向月球" tabindex="-1"><a class="header-anchor" href="#_02月13日-带我飞向月球" aria-hidden="true">#</a> 02月13日：带我飞向月球</h3><h4 id="阿卡切斯瞭望台-月亮谷-智利-©-ignacio-palacios-getty-images" tabindex="-1"><a class="header-anchor" href="#阿卡切斯瞭望台-月亮谷-智利-©-ignacio-palacios-getty-images" aria-hidden="true">#</a> 阿卡切斯瞭望台，月亮谷，智利（© Ignacio Palacios/Getty Images）</h4><p><img src="https://cn.bing.com/th?id=OHR.MoonValley_ZH-CN1906470869_800x480.jpg&amp;rf=LaDigue_800x480.jpg" alt="带我飞向月球" title="带我飞向月球"></p><p>月亮谷位于智利北部的阿塔卡马沙漠，有着令人惊叹的美景。1982年，月亮谷被列为自然保护区，这是因为它拥有极吸引人的、未受破坏的原生环境和奇特的月球地形。关于月亮谷还有一个有趣的知识，那就是这片沙漠已经很多年未下过一滴雨了。</p><p>月亮谷的地形干燥恶劣，于是科学家们在那里测试了一辆火星探测器的原型。</p>',6),We={href:"https://cn.bing.com/search?q=%e6%99%ba%e5%88%a9%e6%9c%88%e4%ba%ae%e8%b0%b7&form=hpcapt&filters=HpDate:%2220230212_1600%22",title:"必应今日图片 2023 2月 13",target:"_blank",rel:"noopener noreferrer"},Ae={href:"https://cn.bing.com/search?q=Bing+homepage+quiz&filters=WQOskey:%22HPQuiz_20230213_MoonValley%22&FORM=HPQUIZ",title:"必应主页测验 2023 2月 13",target:"_blank",rel:"noopener noreferrer"},Ve={href:"https://cn.bing.com/th?id=OHR.MoonValley_ZH-CN1906470869_800x480.jpg&rf=LaDigue_800x480.jpg",title:"阿卡切斯瞭望台，月亮谷，智利",target:"_blank",rel:"noopener noreferrer"},ve={href:"https://cn.bing.com/th?id=OHR.MoonValley_ZH-CN1906470869_1280x720.jpg&rf=LaDigue_1280x720.jpg",title:"阿卡切斯瞭望台，月亮谷，智利",target:"_blank",rel:"noopener noreferrer"},Ge={href:"https://cn.bing.com/th?id=OHR.MoonValley_ZH-CN1906470869_1920x1080.jpg&rf=LaDigue_1920x1080.jpg",title:"阿卡切斯瞭望台，月亮谷，智利",target:"_blank",rel:"noopener noreferrer"},Se={href:"https://cn.bing.com/th?id=OHR.MoonValley_ZH-CN1906470869_UHD.jpg&rf=LaDigue_UHD.jpg",title:"阿卡切斯瞭望台，月亮谷，智利",target:"_blank",rel:"noopener noreferrer"},Ee=a('<hr><h3 id="_02月12日-平稳着陆-双脚先行" tabindex="-1"><a class="header-anchor" href="#_02月12日-平稳着陆-双脚先行" aria-hidden="true">#</a> 02月12日：平稳着陆，双脚先行</h3><h4 id="一对蓝脚鲣鸟-加拉帕戈斯群岛-厄瓜多尔-©-tui-de-roy-minden-pictures" tabindex="-1"><a class="header-anchor" href="#一对蓝脚鲣鸟-加拉帕戈斯群岛-厄瓜多尔-©-tui-de-roy-minden-pictures" aria-hidden="true">#</a> 一对蓝脚鲣鸟，加拉帕戈斯群岛，厄瓜多尔（© Tui De Roy/Minden Pictures）</h4><p><img src="https://cn.bing.com/th?id=OHR.BoobyDarwinDay_ZH-CN9917306809_800x480.jpg&amp;rf=LaDigue_800x480.jpg" alt="平稳着陆，双脚先行" title="平稳着陆，双脚先行"></p><p>今天，我们将和加拉帕戈斯群岛海岸的蓝脚鲣鸟一起玩耍，来庆祝达尔文日。据说，鲣鸟的英文名（booby）来源于西班牙语的单词，意思是“傻瓜”。鲣鸟之所以有这样的名字，是因为它们很容易被水手们抓到，因此被认为不太聪明。它们与众不同的亮蓝色脚丫很显眼。蓝脚鲣鸟的一大特点是它们的求偶舞蹈，雄性蓝脚鲣鸟会在大庭广众之下欢快地跺着蓝色脚丫跳舞求偶。雌性体型比雄性稍大一些。这种鸟终身只有一个伴侣，它们还能通过独特的叫声认出自己的伴侣。</p><p>蓝脚鲣鸟不筑巢，而是在光秃秃的地上产蛋。</p>',6),Ye={href:"https://cn.bing.com/search?q=%e8%93%9d%e8%84%9a%e9%b2%a3%e9%b8%9f&form=hpcapt&filters=HpDate:%2220230211_1600%22",title:"必应今日图片 2023 2月 12",target:"_blank",rel:"noopener noreferrer"},Te={href:"https://cn.bing.com/search?q=Bing+homepage+quiz&filters=WQOskey:%22HPQuiz_20230212_BoobyDarwinDay%22&FORM=HPQUIZ",title:"必应主页测验 2023 2月 12",target:"_blank",rel:"noopener noreferrer"},Je={href:"https://cn.bing.com/th?id=OHR.BoobyDarwinDay_ZH-CN9917306809_800x480.jpg&rf=LaDigue_800x480.jpg",title:"一对蓝脚鲣鸟，加拉帕戈斯群岛，厄瓜多尔",target:"_blank",rel:"noopener noreferrer"},Ke={href:"https://cn.bing.com/th?id=OHR.BoobyDarwinDay_ZH-CN9917306809_1280x720.jpg&rf=LaDigue_1280x720.jpg",title:"一对蓝脚鲣鸟，加拉帕戈斯群岛，厄瓜多尔",target:"_blank",rel:"noopener noreferrer"},Xe={href:"https://cn.bing.com/th?id=OHR.BoobyDarwinDay_ZH-CN9917306809_1920x1080.jpg&rf=LaDigue_1920x1080.jpg",title:"一对蓝脚鲣鸟，加拉帕戈斯群岛，厄瓜多尔",target:"_blank",rel:"noopener noreferrer"},$e={href:"https://cn.bing.com/th?id=OHR.BoobyDarwinDay_ZH-CN9917306809_UHD.jpg&rf=LaDigue_UHD.jpg",title:"一对蓝脚鲣鸟，加拉帕戈斯群岛，厄瓜多尔",target:"_blank",rel:"noopener noreferrer"},et=a('<hr><h3 id="_02月11日-布满星星的天空" tabindex="-1"><a class="header-anchor" href="#_02月11日-布满星星的天空" aria-hidden="true">#</a> 02月11日：布满星星的天空</h3><h4 id="死亡谷扎布里斯基角上空的银河-美国加利福尼亚州-©-matt-anderson-photography-getty-images" tabindex="-1"><a class="header-anchor" href="#死亡谷扎布里斯基角上空的银河-美国加利福尼亚州-©-matt-anderson-photography-getty-images" aria-hidden="true">#</a> 死亡谷扎布里斯基角上空的银河，美国加利福尼亚州（© Matt Anderson Photography/Getty Images）</h4><p><img src="https://cn.bing.com/th?id=OHR.DarkSkiesDV_ZH-CN1076500221_800x480.jpg&amp;rf=LaDigue_800x480.jpg" alt="布满星星的天空" title="布满星星的天空"></p><p>扎布里斯基角的标志性景观是摄影师和游客一年四季蜂拥而至的原因之一。大自然在这些荒地上侵蚀了亿万年，形成了这片令人惊叹的条纹岩层。这几座山峰上的深色部分是由古代火山爆发的熔岩形成的。扎布里斯基角位于加利福尼亚州的死亡谷国家公园，是无数电影（如《斯巴达克斯》和《星球大战》）的取景地。爱尔兰摇滚乐队U2的音乐专辑《约书亚树》的封面也在这里取景。难怪死亡谷暗夜节在美国如此受欢迎。</p><p>死亡谷国家公园已经被评为黄金级暗夜公园——这是国际暗夜协会对夜空的最高评级。</p>',6),tt={href:"https://cn.bing.com/search?q=%e7%be%8e%e5%9b%bd%e6%ad%bb%e4%ba%a1%e8%b0%b7%e5%9b%bd%e5%ae%b6%e5%85%ac%e5%9b%ad&form=hpcapt&filters=HpDate:%2220230210_1600%22",title:"必应今日图片 2023 2月 11",target:"_blank",rel:"noopener noreferrer"},rt={href:"https://cn.bing.com/search?q=Bing+homepage+quiz&filters=WQOskey:%22HPQuiz_20230211_DarkSkiesDV%22&FORM=HPQUIZ",title:"必应主页测验 2023 2月 11",target:"_blank",rel:"noopener noreferrer"},nt={href:"https://cn.bing.com/th?id=OHR.DarkSkiesDV_ZH-CN1076500221_800x480.jpg&rf=LaDigue_800x480.jpg",title:"死亡谷扎布里斯基角上空的银河，美国加利福尼亚州",target:"_blank",rel:"noopener noreferrer"},at={href:"https://cn.bing.com/th?id=OHR.DarkSkiesDV_ZH-CN1076500221_1280x720.jpg&rf=LaDigue_1280x720.jpg",title:"死亡谷扎布里斯基角上空的银河，美国加利福尼亚州",target:"_blank",rel:"noopener noreferrer"},it={href:"https://cn.bing.com/th?id=OHR.DarkSkiesDV_ZH-CN1076500221_1920x1080.jpg&rf=LaDigue_1920x1080.jpg",title:"死亡谷扎布里斯基角上空的银河，美国加利福尼亚州",target:"_blank",rel:"noopener noreferrer"},ot={href:"https://cn.bing.com/th?id=OHR.DarkSkiesDV_ZH-CN1076500221_UHD.jpg&rf=LaDigue_UHD.jpg",title:"死亡谷扎布里斯基角上空的银河，美国加利福尼亚州",target:"_blank",rel:"noopener noreferrer"}